  false,\n\t\"url\": null,\n\t\"notes\": \"The University of Hawaii at Manoa, School
  of Ocean and Earth Science and Technology (SOEST)n               is a partner in
  the Index to Marine and Lacustrine Geological Samples (IMLGS) database, contributing
  \    n               information to the IMLGS to help researchers discover geological
  samples curated in their facility.n               The partner repository may also
  send related data, documents, and imagery to NCEI for long-term archive, n               but
  the originating institution is the definitive source of information related to their
  sample collection. n               The SOEST dredge repository is under the Department
  of Geology and Geophysics, the core repository is under n               the Department
  of Oceanography.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
